import React, { Component } from 'react'
class LogoutComponent extends Component {
    render() {
        return (
            <>
                <h1>Вы разлогинились</h1>
                <div className="container">
                    Спасибо за использование нашего приложения.
                </div>
            </>
        )
    }
}
export default LogoutComponent
